import React from "react";

function FilterYear(props) {
  const year = (y) => { 
    const fyear = Array.from(new Set(y.date));
    const filterY = [...fyear]
    return filterY;
  };

  console.log(filterY);
  return (
    <div
      style={{
        display: "flex",
        width: "93%",
        height: 50,
        fontSize: 20,
        margin: 20,
        justifyContent: "space-between",
        alignItems: "center",
      }}
    >
      <b
        style={{
          color: "white",
        }}
      >
        Filter by year
      </b>
      <select
        style={{
          color: "black",
          width: 190,
          borderRadius: 5,
          right: 0,
          height: 50,
          fontSize: 20,
          fontWeight: "bold",
          textAlign: "center",
        }}
        onChange={props.onClick}
      >
        {year(props.detailDate).map((value, i) => {
          return <option key={i}>{value}</option>;
        })}
      </select>
    </div>
  );
}

export default FilterYear;
